@elcar –ü–ª–æ—Ö–æ –≤–ª–∞–¥–µ–µ—Ç–µ –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–µ–π. Though estimates vary widely, approximately 900,000 North Koreans, or 10 percent of North Korea's population, migrated to the South between 1945 and 1953. This period is divided into two parts: liberation after Japanese colonialism (August 15, 1945 to June 25, 1950) and the Korean War (June 25, 1950 to July 27, 1953). The 900,000 estimate does not include South Koreans who returned to the South from North Korea or Manchuria during the liberation period, or POWs who moved following the armistice agreement.
